// TwitterContainer.js
import React, { useEffect } from "react";
import { ISvgRectProps } from "../types/types";
import { defaultColor, selectedColor } from "../utils/MapStyles";

const SvgRect = (props: ISvgRectProps) => {

    return (
        <>
        <svg width="25" height="25" >
            <rect width="25" height="25" fill={defaultColor[0]} strokeWidth='5' stroke={selectedColor[0]} />
        </svg>
        <p className='layerlabel'>visited</p>
        </>
    );
};

export default SvgRect;
